import React, { useEffect, useState } from 'react';
import axios from "axios";

const Result = () => {

    const [document,setDocument]=useState([]);
    console.log("test");
    useEffect(()=>{
        axios.get("k/auteur").then((res)=>setDocument(res.data))
     
    },[])

    return (
        <div className="Result" align="center">
            <h1> Liste des resultat</h1>
            <div className="container">
                <div className="row">
                    <div className=" border border-primary rounded col-10">
                    RESULTAT

                   
                  {document.map(doc=> 
                     <div className="card"  key={doc.id} >
                        <h5 className="card-header">{doc.auteur}</h5>
                         <div className="card-body">
                             <h5 className="card-title" >{doc.titre}</h5>
                             <p className="card-text">With supporting text below as a natural lead-in to additional content.</p>
                             <a href="#" className="btn btn-primary">Modifier</a>
                             <a href="#" className="btn btn-primary">Supprimer</a>
                             <a href="#" className="btn btn-primary">Go somewhere</a>
                         </div>
                     </div>
                    
                  )}

                  
                    </div>
                </div>
                </div>
             </div>
    );
};

export default Result;
